INSERT INTO `yunu_diy_productmedicine` VALUES (1,'','<p>【药品名称】通用名称：羚羊感冒胶囊 汉语拼音：Lingyang ganmao jiaonang</p><p>【成&nbsp; &nbsp; &nbsp; &nbsp;份】羚羊角、牛蒡子、淡豆鼓、金银花、荆芥、连翘、淡竹叶、桔梗、薄荷脑、甘草。<br/></p><p>【性&nbsp; &nbsp; &nbsp; &nbsp;状】本品为胶囊剂，内容物显黄棕色；气香、味凉、苦而后微甜。<br/></p><p>【功能主治】解热解表。用于流行性感冒，伤风咳嗽，头晕发热，咽喉肿痛。<br/></p><p>【包装规格】0.42g*12粒*300盒<br/></p><p>【用法用量】口服。一次2粒，一日2-3次。<br/></p><p>【禁&nbsp; &nbsp; &nbsp; &nbsp;忌】孕妇禁用。<br/></p><p>【注意事项】<br/></p><p><br/></p>','','这是副标题',''),(95,'/uploads/image/20191029/e1ee8bce0bed57a60c908bd81db2a44a.jpg***/uploads/image/20191029/a2d67e010f85edb08fc290c709ad424b.jpg***/uploads/image/20191029/a712808ffb129eb59cc5893da80c2e08.jpg***/uploads/image/20191029/6d7956190816af10ac8e09cdabf4285e.jpg***','<p>规格：不定（cm）&nbsp;</p><p>风格：中式现代&nbsp;</p><p>标准：马赛克&nbsp;</p><p>产地：浙江&nbsp;</p>','<p>创立于2000年， 经过多年的不懈努力，公司现已经成为一家专业从事IT产品开发、生产和销售的高科技企业。公司成立几年来，一直致力于工控/服务器机箱及各种非标箱体的开发与生产，产品现广泛应用于计算机网络、监控、安防、广电、通讯和仪器设备等多种行业，公司设计生产的多种标准及非标产品，成功地替代了多种进口产品，为用户极大地降低了成本，也为我们的民族事业做出了我们的一份贡献！\n&nbsp;</p><p>公司的主要产品大类别有：19″服务器机箱、工控机箱、网络机柜、服务器机柜、非标机柜、各种操作台、电视墙、非线性编辑台、配电柜（强弱电）、各种机箱。我们的产品结构合理，性能稳定可靠，品质优良，品种齐全。</p>','',''),(98,'/uploads/image/20191029/e1ee8bce0bed57a60c908bd81db2a44a.jpg***/uploads/image/20191029/a2d67e010f85edb08fc290c709ad424b.jpg***/uploads/image/20191029/a712808ffb129eb59cc5893da80c2e08.jpg***/uploads/image/20191029/6d7956190816af10ac8e09cdabf4285e.jpg***','<p>规格：不定（cm）&nbsp;</p><p>风格：中式现代&nbsp;</p><p>标准：马赛克&nbsp;</p><p>产地：浙江&nbsp;</p>','<p>创立于2000年， 经过多年的不懈努力，公司现已经成为一家专业从事IT产品开发、生产和销售的高科技企业。公司成立几年来，一直致力于工控/服务器机箱及各种非标箱体的开发与生产，产品现广泛应用于计算机网络、监控、安防、广电、通讯和仪器设备等多种行业，公司设计生产的多种标准及非标产品，成功地替代了多种进口产品，为用户极大地降低了成本，也为我们的民族事业做出了我们的一份贡献！\n&nbsp;</p><p>公司的主要产品大类别有：19″服务器机箱、工控机箱、网络机柜、服务器机柜、非标机柜、各种操作台、电视墙、非线性编辑台、配电柜（强弱电）、各种机箱。我们的产品结构合理，性能稳定可靠，品质优良，品种齐全。</p>','',''),(56,'/uploads/image/20191029/e1ee8bce0bed57a60c908bd81db2a44a.jpg***/uploads/image/20191029/a2d67e010f85edb08fc290c709ad424b.jpg***/uploads/image/20191029/a712808ffb129eb59cc5893da80c2e08.jpg***/uploads/image/20191029/6d79